import { mapGetters } from "vuex";
export default {
  name: "SearchSelector",
  computed: {
    ...mapGetters(["attrsList", "trademarkList"]),
  },
  methods:{
    // 面包屑品牌点击事件
    // 自定义事件,子组件向父组件传递数据
    tradeMarkHandler(trademark){
    //  整理品牌字段参数
    this.$emit('trademarkInfo',trademark);
    },
    // 平台售卖属性值的点击事件
    // 自定义事件,子组件向父组件传递数据
    attrHandler(attrs,attrvalue){
    this.$emit("attrInfo",attrs,attrvalue);
    }


  }
};
